import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const heartbeat = 1000;
var data = require("../data");

export default class ValveView extends React.Component {
    useStyles = makeStyles({
      table: {
        minWidth: 650,
      },
    });

    createData = function (sensor, ss, readout) {
      if (ss == 1) {
          ss = 'High'
      } else {
          ss = 'Low'
      }
      return { sensor, ss, readout };
    }

    divStyle = {
        marginLeft: "15px"
    };

    rows = [
      this.createData("PT1", 0, 0),
      this.createData("PT2", 0, 0),
      this.createData("PT3", 0, 0),
      this.createData("PT4", 0, 0),
      this.createData("PT5", 0, 0),
      this.createData("PT6", 0, 0),
      this.createData("PT7", 0, 0),
      this.createData("PT8", 0, 0)
    ];

    render () {
        return (
          <TableContainer component={Paper} style={this.divStyle}>
            <Table aria-label="simple table">
              <TableHead>
                <TableRow>
                  <TableCell align="left">Name</TableCell>
                  <TableCell align="right">Switch Status</TableCell>
                  <TableCell align="right">Readout</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {this.rows.map(row => (
                  <TableRow key={this.row.name}>
                    <TableCell component="th" scope="row">
                      {this.row.sensor}
                    </TableCell>
                    <TableCell align="right">{this.row.ss}</TableCell>
                    <TableCell align="right">{this.row.readout}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        )
    }
}
